import React from "react";

const Navigation = () => {
  return (
    <nav
      style={{
        display: "flex",
        justifyContent: "flex-end",
        background: "black",
      }}
    >
      <p className="">Sign Out</p>
    </nav>
  );
};

export default Navigation;
